import React from 'react'
import Video from '../../videos/video4.mp4';
import {HeroContainer, HeroBg, VideoBg, HeroH1, HeroP, HeroBtnWrapper, ArrowForward, ArrowRight} from './heroElements';

const HeroSection = () => {
    return (
        <HeroContainer id="home">
            <HeroBg>
                <VideoBg autoPlay loop muted src={Video} type='video/mp4'/>
            </HeroBg>
            <HeroContent>
                <HeroH1> Galaxy Girl MUA</HeroH1>
                <HeroP> "Everything has beauty in it, but not everyone sees it" - Confucius </HeroP>
                <HeroBtnWrapper>
                    <Button to="">Work with me! { hover ? <ArrowForward/> : <ArrowRight/> } </Button>
                </HeroBtnWrapper>
            </HeroContent>
        </HeroContainer>
    )
}

export default HeroSection
